import styled from "styled-components";
var request = require("request");

var options = { method: 'POST',
  url: 'https://dev-luqm6uty.auth0.com/oauth/token',
  headers: { 'content-type': 'application/json' },
  body: '{"client_id":"8n2hhPWxduK9g90PTPYrA7bEEbkxwhK7","client_secret":"pP6ufCzQv_Trm60G4Jhxz0tdxxMSuiLIwteCj9lHezLzZFgpRobSPK4o8t1jDr1h","audience":"https://dev-luqm6uty.auth0.com/api/v2/","grant_type":"client_credentials"}' };

request(options, function (error, response, body) {
  if (error) throw new Error(error);

  console.log(body);
});
const Picture = styled.img`
border-radius: 50%;
border: 3px solid white;
width: 100px;
`;

const Profile = ({ user }) => {
    return (
      <div>
        <h2>
          <Picture src={user.picture} alt={user.displayName} /> Hello, {user.displayName}
        </h2>
        
        <p>This is what we know about you:</p>
        <ul>
          { Object.keys(user).map(key => (
            <li key={key}>{key}: {user[key].toString()}</li>
          ))}
        </ul>
        
      </div>
    );
  }
  
  export default Profile;
